// export default Table;

import React from 'react';

export default props => (
    <table className="table">
        <thead>
            <tr>
                <th>Investor's name</th>
                <th>Investor's commitment</th>
                <th>Investor's Prior Contribution</th>
                <th>Investor's Contribution to transfer</th>
                <th>Investor's Unfunded Commitment</th>
            </tr>
        </thead>
        <tbody>
            { props.data.map(item =>(
                <tr key={item.id}>
                    <td>{item.investor_name}</td>
                    <td>{item.commitment}</td>
                    <td>{item.prior_contribution}</td>
                    <td>{item.transfer_contribution}</td>
                    <td>{item.unfunded_commitment}</td>
                </tr>
            ))}
        </tbody>
    </table>
)
